import React from "react";


const Navbar = () =>{
    return (
        <nav className="navbar navbar-expand-lg fixed-top navbar-light border-bottom-info mb-3">
          <div className="container">
            <Link className="navbar-brand" to="http://www.masterkeegroup.com">Masterkee Group</Link>
            
          </div>
        </nav>
    );
  
}

export default Navbar;
